var touchinterval = null
var $vibrate = false
new Vue({
    el:'#app',
    data: {
        seconds: null,
        equation: '0',
        isDecimalAdded: false,
        isOperatorAdded: false,
        isStarted: false,
        displaySmall: false,
        longtouch: null,
        isMute:false,
        mp3Sound: {
            "0": "data:audio/mpeg;base64,",
            "1": "data:audio/mpeg;base64,",
            "2": "data:audio/mpeg;base64,",
            "3": "data:audio/mpeg;base64,",
            "4": "data:audio/mpeg;base64,",
            "5": "data:audio/mpeg;base64,",
            "6": "data:audio/mpeg;base64,",
            "7": "data:audio/mpeg;base64,",
            "8": "data:audio/mpeg;base64,",
            "9": "data:audio/mpeg;base64,",
            "a": "data:audio/mpeg;base64,",
            "-": "data:audio/mpeg;base64,",
            "x": "data:audio/mpeg;base64,",
            "c": "data:audio/mpeg;base64,",
            "b": "data:audio/mpeg;base64,",
            "t": "data:audio/mpeg;base64,",
            "d": "data:audio/mpeg;base64,",
            "e": "data:audio/mpeg;base64,"
        }
    },
    methods:{
        toggleSound(){
            this.isMute = !this.isMute
        },
        result:function () {
            let myDate=new Date()
            let sec = ('0'+ myDate.getSeconds()).slice(-2)
            let mi =('0'+ myDate.getMinutes()).slice(-2)
            let hours = ('0'+ myDate.getHours()).slice(-2)
           this.seconds = 'NOW :'+ hours + ':'+ mi + ':' + sec
        },
        Supdate:function () {
            const timer = setInterval(function () {
                this.result()

            }.bind(this),1000)
        },
        isOperator:function(chart){
            return ['+','-','x','÷'].indexOf(chart) >-1
        },
        calculateToggle:function () {
            if (this.isOperatorAdded || !this.isStarted) {
                return
            }

            this.equation = this.equation + '* -1'
            this.calculate()
        },
        calculatePercentage:function () {
            if (this.isOperatorAdded || !this.isStarted) {
                return
            }

            this.equation = this.equation + '* 0.01'
            this.calculate()
        },
        clear:function () {
            this.equation = '0'
            this.playSound('t')
            this.isDecimalAdded = false
            this.isOperatorAdded = false
            this.isStarted = false

            clearInterval(touchinterval)
        },
        append:function(key){
            this.playSound(key)
            if(this.equation==='0' && !this.isOperator(key) ) {
                if(key ==='.'){
                    this.equation += key + ''
                    this.isDecimalAdded = true
                }else {
                    this.equation= key +''
                }
                this.isStarted = true
                return
            }
            if(!this.isOperator(key)){
                if(key ==='.' && this.isDecimalAdded){
                    return;
                }
                if(key ==='.'){
                    this.isDecimalAdded = true
                    this.isOperatorAdded = true
                }else{
                    this.isOperatorAdded = false
                }

                this.equation += '' + key
            }

            if (this.isOperator(key) && !this.isOperatorAdded){
                if(this.equation ==='0'){
                    this.isStarted = true
                }
                this.equation += ''+ key
                this.isOperatorAdded = true
                this.isDecimalAdded = false
            }
        },
        calculate:function () {
            this.playSound('=',false)
            if (this.isOperatorAdded || !this.isStarted) {
                return
            }

            let result = this.equation
                .replace(new RegExp('x','g'),'*')
                .replace(new RegExp('÷','g'),'/')
            this.equation = parseFloat( eval(result).toFixed(9))
                .toString()
            this.isDecimalAdded = this.equation.indexOf('.') > -1;
            this.isOperatorAdded = false
        },
        backoff:function () {
            let last = this.equation.slice(-1)
            if(last === '.'){
                this.isDecimalAdded = false
            }
            if (this.isOperator(last)){
                this.isOperatorAdded = false
            }
            this.playSound('b')
            this.equation = this.equation.slice(0,this.equation.length-1)
        },
        playSound:function (e,append = true) {
            if($vibrate){
                navigator.vibrate(50);
            }
            if(this.isMute) return;
           if(append){
               if(e==='÷') e = 'c'
               if(e ==='.') e = 'd'
               if(e ==='+') e = 'a'
               const audio = new Audio(this.mp3Sound[e])
               audio.play()
               return;
           }

            switch (e) {
                case '=':
                    const audio = new Audio(this.mp3Sound.e)
                    audio.play()
                    break
            }


        },
        gotouchstart(){
            this.backoff()
            touchinterval = setInterval(function(){
                this.backoff()
            }.bind(this),250)
        },
        mouseup(){
            clearInterval(touchinterval)
        },
        gotouchend(){
            clearInterval(touchinterval)
        }
    },
    mounted(){
        this.Supdate()
        setTimeout(()=>{
            navigator.vibrate = navigator.vibrate || navigator.webkitVibrate || navigator.mozVibrate || navigator.msVibrate;
            if(navigator.vibrate) {   //支持震动
                $vibrate = true
            }
        },1000)
    },
    watch:{
        equation:function (val) {
            if(val.length>12){
                this.displaySmall = true
            }else{
                this.displaySmall = false
            }
            if(val.length === 0){
                this.equation= '0'
            }
        }
    }
})
